// import logo from './logo.svg';
import './App.css';
import { Component } from 'react';

class App extends Component {
  constructor() {
    super();
    this.state = {
      monsters: []
    }


  }
  componentDidMount() {
    fetch('https://jsonplaceholder.typicode.com/users')
      .then(res => res.json())
      .then(users => this.setState({ monsters: users }))
  }
  render() {
    return (
      <div className="App">
        {
          this.state.monsters.map(monter => <h1 key={monter.id} >{monter.name}</h1>)
        }
      </div>
    )
  };
}

export default App;
